import React from 'react';
import { useTheme } from '../themeProvider/ThemeProvider';


const Header = () => {
  const { toggleTheme } = useTheme();

  return (
    <header>
      <h1>Expense Tracker</h1>
      <Toggle toggleTheme={toggleTheme} /> {/* Use the Toggle component */}
    </header>
  );
};

export default Header;
